const mode = "live";
const site = "triangles";
const siteUrl = "https://" + site + ".edusquares.com/";
// const siteUrl = "http://localhost:8080/tuningfork/";
// const siteUrl = "https://erp.nttftrg.com/";
const Config = {
    siteTitle: site,
    siteMode:  mode,
    siteUrl :  siteUrl,
    baseUrl :  siteUrl + 'rest/mobile/',
    apiUrl  :  siteUrl + 'rest/mobile/ilearn/',
    getGamePlay: siteUrl + 'api/common/game/gameplays',
    getBatch: siteUrl + 'api/common/batches?',
    getBatchforEnquiry: siteUrl + 'api/common/enquiry/',
    getLearnersforBatchId :  siteUrl + 'api/common/batches/',
    logo    :  "https://webfront.edusquares.com/" + site + "/files/pwa/logo.jpg",
    cover   :  "https://webfront.edusquares.com/" + site + "/files/pwa/cover.jpg",
    pdfUrl  :  siteUrl,
    desktopApi  :  siteUrl + 'api/',
    AWSRegion: "ap-southeast-1",
    AWSEndpoint: '',
    AWSAccessKeyId: "",
    AWSSecretAccessKey: "",
    CONNECTION_ERROR_MSG: "The server is taking too long to respond OR something is wrong with your internet connection. Please try again later." 
}

export const OpenLoginTypes = {
    //Open Login Types
    OPEN_LOGIN_TYPE_FACEBOOK : 1,
    OPEN_LOGIN_TYPE_GOOGLE : 2 
}

const CURRENT_PORTLET = null;

export default Config;
